          crossorigin="anonymous"
        />
        <link rel="stylesheet" href="/css/style.css" />
        <title>Grand Exchange</title>
      </head>
      <body>
        <main>{props.children}</main>
      </body>
    </html>
  );
};

module.exports = Layout;

